            "text" : "똑똑 저 들어가요 아니 이미 들어왔어요. \n산타…인 척하는 보니산타 등장이에요 oO(산타주머니임 https://t.co/CR5ZQHDmxe  https://t.co/kAnyHdZbqL )\n\n안녕 일칠 씨… 메리 크리스마스! 는 좀 늦었을까? \n원래는 손편지를… 선물이랑 같이 주고 싶었는데 이만저만 선물 고민 줘도 되는지 고민 부담스럽진 않을지 고민 이것저것 고민 하다가 이렇게 됐어.요. … …\n트리에도 웅얼웅얼 헛소리만 가득 해둔 것 같기도 하고 고맙고 미안하다고 꼬옥 말해주고 싶기도 하고 아무튼 그래서 너 선물 고르느라 드릭이도 좀 괴롭히고 그랬어. 너네 드릭이 이용해 먹어서 미앙. … 알다시피 내가 너한테 말 거는 걸 힘들어하니까.\n근데 사실 원래 진짜 아무렇지 않았는데 언젠가부터 그냥… 뭔가!! 그냥… 좀 너무? 치근덕?… 말이 이상한데 그러는 거 같기두 하고 조심스러워져서 더 그런 것 같아. 물론 너는 괜찮다고 했지만 그냥 내가 찐따인 걸루 하자. 드릭이 말이 맞나부다. \n\n우선 선물부터 설명을 해보자면…!\n너어 맨날 늦게 자고 조금 자고 새벽에도 아침에도 있고 막 2시간. 이렇게 자고… 몸 상해 정말. 나 진짜 선물하기에 있는 필로우미스트는 다 본 것 같아. 향은 취향을 너무 많이 타니까… 드릭이에게 다시 한 번 감사합니다… 암튼! 너는 취향도 참 너랑 잘 어울린다. 나 드릭이한테 찐따소리 삼천 번 들었어… 힘들게 골랐는데 잘 보구 너 마음에 들 것 같은 향으로 바꿔서 배송 신청해! 상대가 잘 자길 바라면 그게 사랑이라던데 나 진짜 너 사랑하나 봐. 웃겨. 오래 잘 수 없더라도 춥고 어두운 밤이 길지 않았으면 좋겠어. 니가 매일 깊게 잘 잤으면 좋겠어. 그래서 골랐는데 마음에 들었으면 좋겠다. 그리고 쿠키는… 뭔가 연말하면 틴케이스에 든 쿠키가 떠오르지 않아? 북유럽 어딘가 벽난로 앞 그런 감성. 뭔지 알지? 그러니까 그냥 맛있게 먹으면 돼! 따뜻하고 행복하게. \n\n우와. 나 말 진짜 많다 그치. 뭔가 늘 너한테 고맙기도 미안하기도 하고 그래. … … 내가 너무 부담?이 되겠다 싶기도 하고 근데 또 너무 좋고 보고 싶고… (당신이죄가많은거아닐까요?죄송합니다) 내 눈에 보이지 않더라도 그냥 너의 하루가 늘 행복했으면 좋겠어. 힘들어 했던 걸 봐서 그런 걸까? 모두에게 사랑받는 건 불가능하지만 내가 본 너는. 그러니까 나의 라이너 일칠 기벤라트는. 아주 아주 다정하고 (물론너T야?는확실함) 친구들을 좋아하고! 그리고 바보같이 고장나서 대답하기도 어렵게 말하는 나한테도 잘 대답해주고… 인테리어로 써주겠다고도 하고… 업계포상?이 이런 거 맞죠. 그러니까 꼭. 너에게 닿는 모든 사람들은 꼭 너만큼만이라도 다정하고 따뜻한 사람들이면 좋겠어. 사랑이야… 내가 해주면 그만이야. \n\n나지금너답멘때문에편지쓸멘탈이안남았어. 그러니까 구구절절 말했지만 결론은… 알지? 고마워! 올해 나랑 만나줘서. … …(이거뭔가말이이상한가?뭔말인지알지?) 그리고 매번… 의도치 않게 눈치주는 것 같아서 미안해 그냥 나를 뮤트?하는 건 어떨까?… 끝내려다 또 길어진다. 그만 헛소리할게. 남은 겨울이 너무 춥지 않길! 또… 돌아올 계절에도 늘! 행복해야 해. 사랑해!",
